import React from 'react';
import { Routes, Route, Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import styled from 'styled-components';

const DashboardContainer = styled.div`
  min-height: 100vh;
  display: flex;
`;

const Sidebar = styled.div`
  width: 250px;
  background: ${props => props.theme.colors.surface};
  padding: 2rem;
  border-right: 1px solid ${props => props.theme.colors.border};
`;

const MainContent = styled.div`
  flex: 1;
  padding: 2rem;
  background: ${props => props.theme.colors.background};
`;

const NavLink = styled(Link)`
  display: block;
  padding: 0.75rem 1rem;
  color: ${props => props.theme.colors.text};
  text-decoration: none;
  border-radius: 4px;
  margin-bottom: 0.5rem;
  transition: background 0.2s;

  &:hover {
    background: ${props => props.theme.colors.hover};
  }

  &.active {
    background: ${props => props.theme.colors.primary};
    color: white;
  }
`;

const LogoutButton = styled.button`
  width: 100%;
  padding: 0.75rem;
  background: ${props => props.theme.colors.error};
  color: white;
  border: none;
  border-radius: 4px;
  cursor: pointer;
  margin-top: 2rem;

  &:hover {
    background: ${props => props.theme.colors.errorDark};
  }
`;

const DashboardHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-bottom: 2rem;
`;

const DashboardTitle = styled.h1`
  color: ${props => props.theme.colors.primary};
  font-size: 1.5rem;
`;

const AdminDashboard = () => {
  const { user, logout } = useAuth();
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/admin/login');
  };

  return (
    <DashboardContainer>
      <Sidebar>
        <DashboardTitle>Admin Panel</DashboardTitle>
        <nav>
          <NavLink to="/admin/dashboard">Overview</NavLink>
          <NavLink to="/admin/projects">Projects</NavLink>
          <NavLink to="/admin/services">Services</NavLink>
          <NavLink to="/admin/about">About</NavLink>
          <NavLink to="/admin/contact">Contact</NavLink>
        </nav>
        <LogoutButton onClick={handleLogout}>Logout</LogoutButton>
      </Sidebar>

      <MainContent>
        <Routes>
          <Route path="/" element={<div>Dashboard Overview</div>} />
          <Route path="/projects" element={<div>Projects Management</div>} />
          <Route path="/services" element={<div>Services Management</div>} />
          <Route path="/about" element={<div>About Page Editor</div>} />
          <Route path="/contact" element={<div>Contact Information</div>} />
        </Routes>
      </MainContent>
    </DashboardContainer>
  );
};

export default AdminDashboard;
